webpackJsonp([0x7e5566bf01f6],{4154:function(e,t){e.exports={data:{challengeNode:{title:"Make Dead Links Using the Hash Symbol",description:["有时你想为网站添加一个锚点，但如果你还不确定要将它链接到哪儿，这时可以使用固定链接。","在后面的课程中我们会学到：如何轻松通过<code>JavaScript</code>更改链接指向的地址。","<hr>",'<code>href</code>属性的当前值是指向 "http://freecatphotoapp.com"，将<code>href</code>属性的值替换为<code>#</code>，也称为井号，就可以创建固定链接。','例如: <code>href="#"</code>'],challengeType:0,fields:{slug:"/responsive-web-design/basic-html-and-html5/make-dead-links-using-the-hash-symbol",blockName:"Basic HTML and HTML5",tests:[{text:'锚点的<code>href</code>属性应为 "#"。',testString:'assert($("a").attr("href") === "#", \'锚点的<code>href</code>属性应为 "#"。\');'}]},required:[],files:{indexhtml:{key:"indexhtml",ext:"html",name:"index",contents:'<h2>CatPhotoApp</h2>\n<main>\n  <p>点击这里可以获取更多<a href="http://freecatphotoapp.com" target="_blank">猫图</a>。</p>\n  \n  <img src="http://cdn.freecodecamp.cn/relaxing-cat.jpg" alt="一只仰卧着的萌猫">\n  \n  <p>在大家心目中，猫是慵懒和可爱的化身，它可以睡饱了再起来吃饭，可以逗趣小耗子，可以卖得了萌，使得了坏，这样百变的小怪兽就集结在一只宠物上，怎能不惹人怜爱。</p>\n  <p>养猫有的时候，就是介于爱与恨之间，当你钦羡别人萌宠这么可爱的时候，你一定没有想过，猫咪会到处掉毛，甚至会屯老鼠，啃鞋子，用爪子爬门，你不理它，它就挠你，你要对它发脾气，它会比你更来劲。所以，猫咪慎入，没有一定的准备，切勿随便去侍养动物。它们一旦认定你了，你就是它们的主人，如果你抛弃它们，它们必定心中重创。</p>\n</main>',head:"",tail:""},indexjs:null,indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/responsive-web-design/basic-html-and-html5/turn-an-image-into-a-link",id:"bad87fee1348bd9aedf08817"},slug:"/responsive-web-design/basic-html-and-html5/make-dead-links-using-the-hash-symbol"}}}});
